Hello. Having some trouble here with a Jasmine test...

I'm testing an API service that uses ```$http```, and mocking the backend with ```$httpBackend```.

The test looks like this:

```javascript
/// api.js

.
.
.

describe('API #get()', function () {

    afterEach(function () {
      $httpBackend.verifyNoOutstandingRequest();
      $httpBackend.verifyNoOutstandingExpectation(); // LINE 33
    });

    it('should return something falsy when the server does', function (done) {
      $httpBackend.expect('GET', 'http://api.example.com/')
        .respond({
          'code': '200',
          'data': {
            'valid': false
          }
        });

      API.get()
        .then(function (valid) {
          expect(valid).toBeFalsy();
          done(); // LINE 52
        });

      $httpBackend.flush(); // LINE 55
    });

  });

});

.
.
.
```

